<script>

    $(document).ready(function () {
       
        var droplist = $('#Batch_reportsforstudent');
        droplist.change(function () {
            if ($('#Batch_reportsforstudent option:selected').val() == 1) {
                $('#department').hide("slow");
                $('#batch').hide("slow");
                $('#subject').hide("slow");
                $('#course').show("slow");

                $('#Batch_courseid').change(function () {
                    $('#studentlist tbody').empty();
                    $.ajax({
                        type: "POST",
                        url: "reportlist",
                        data: {reportfor: $('#Batch_reportfor option:selected').val(), reportsforstudent: $('#Batch_reportsforstudent option:selected').val(), courseid: $('#Batch_courseid option:selected').val()},
                        dataType: "html",
                        success: function (data) {
                            $('#studentlist tbody').append(data);
                             $('#gridview').show("slow");
                        }
                    });
                })
            }
            
            if ($('#Batch_reportsforstudent option:selected').val() == 2) {
                $('#department').hide("slow");
                $('#subject').hide("slow");
                $('#course').show("slow");
                $('#batch').show("slow");

                $('#Batch_batchid').change(function () {

                    $('#studentlist tbody').empty();
                    $.ajax({
                        type: "POST",
                        url: "reportlist",
                        data: {reportfor: $('#Batch_reportfor option:selected').val(), reportsforstudent: $('#Batch_reportsforstudent option:selected').val(), courseid: $('#Batch_courseid option:selected').val(), batchid: $('#Batch_batchid option:selected').val()},
                        dataType: "html",
                        success: function (data) {
                            $('#studentlist tbody').append(data);
                            $('#gridview').show("slow");
                        }
                    });
                })
            }
            
            if ($('#Batch_reportsforstudent option:selected').val() == 3) {
                $('#department').hide("slow");
                $('#course').show("slow");
                $('#batch').show("slow");
                $('#subject').show("slow");

                $('#Batch_subjectid').change(function () {

                    $('#studentlist tbody').empty();
                    $.ajax({
                        type: "POST",
                        url: "reportlist",
                        data: {reportfor: $('#Batch_reportfor option:selected').val(), reportsforstudent: $('#Batch_reportsforstudent option:selected').val(), courseid: $('#Batch_courseid option:selected').val(), batchid: $('#Batch_batchid option:selected').val(), subjectid: $('#Batch_subjectid option:selected').val()},
                        dataType: "html",
                        success: function (data) {
                            $('#studentlist tbody').append(data);
                            $('#gridview').show("slow");
                        }
                    });
                })

            }
        })

    });

</script>
	

		
